var data={"title":"Testosterone: Patient drug information","body":"<div id=\"topicContent\" class=\"utdArticleSection utdStyle\"><div id=\"disclaimer\">The content on the UpToDate website is not intended nor recommended as a substitute for medical advice, diagnosis, or treatment.  Always seek the advice of your own physician or other qualified health care professional regarding any medical questions or conditions.\nThe use of UpToDate content is governed by the <a href=\"https://www.uptodate.com/legal/terms-of-use\" class=\"legal legal_termsofuse\">UpToDate Terms of Use</a>. &copy;2018 UpToDate, Inc. All rights reserved.</div><div id=\"drugTitle\">Testosterone: Patient drug information</div><div id=\"lexiTitleImg\"></div><div class=\"clear\"></div><div id=\"lcoSearchClickUrl\"><a href=\"http://online.lexi.com/lco/action/api/find/globalid/7027?utd=1\" target=\"_blank\">Access Lexicomp Online here.</a></div><div id=\"drugCopy\">Copyright 1978-2018 Lexicomp, Inc. All rights reserved.</div><div id=\"topicText\"><p>(For additional information <a href=\"topic.htm?path=testosterone-drug-information\" class=\"drug drug_general\">see &quot;Testosterone: Drug information&quot;</a> and <a href=\"topic.htm?path=testosterone-pediatric-drug-information\" class=\"drug drug_pediatric\">see &quot;Testosterone: Pediatric drug information&quot;</a>)</p><div xmlns=\"http://www.w3.org/1999/xhtml\" id=\"F225996\" class=\"list ubnlist drugH1Div drugBrandNames\"><span class=\"drugH1\">Brand Names: US</span>\n                  <ul>\n                     <li>Androderm;</li>\n                     <li>AndroGel;</li>\n                     <li>AndroGel Pump;</li>\n                     <li>Aveed;</li>\n                     <li>Axiron [DSC];</li>\n                     <li>Depo-Testosterone;</li>\n                     <li>EC-RX Testosterone;</li>\n                     <li>First-Testosterone MC [DSC];</li>\n                     <li>First-Testosterone [DSC];</li>\n                     <li>Fortesta;</li>\n                     <li>Natesto;</li>\n                     <li>Striant;</li>\n                     <li>Testim;</li>\n                     <li>Testopel;</li>\n                     <li>Vogelxo;</li>\n                     <li>Vogelxo Pump</li></ul></div>\r\n<div xmlns=\"http://www.w3.org/1999/xhtml\" id=\"F225997\" class=\"list cbnlist drugH1Div drugBrandNames\"><span class=\"drugH1\">Brand Names: Canada</span>\n                  <ul>\n                     <li>Andriol;</li>\n                     <li>Androderm;</li>\n                     <li>AndroGel;</li>\n                     <li>Axiron;</li>\n                     <li>Delatestryl;</li>\n                     <li>Depo-Testosterone;</li>\n                     <li>Natesto;</li>\n                     <li>Testim</li></ul></div>\r\n<div xmlns=\"http://www.w3.org/1999/xhtml\" id=\"F10028431\" class=\"ord-stmt war-os drugH1Div\"><span class=\"drugH1\">Warning</span>\n                  <ul style=\"list-style-type:none;\" class=\"statements\">\n                     <li class=\"statement\">\n                        <span style=\"display:none;\" class=\"attributes\">\n                           <span class=\"link\">urn:lims:b498:s5099182</span></span>\n                        <span class=\"content\">\n                           <b>\n                              <span style=\"text-decoration: underline\">Testosterone undecanoate:</span></b></span></li>\n                     <li class=\"statement\">\n                        <span style=\"display:none;\" class=\"attributes\">\n                           <span class=\"link\">urn:lims:b498:s5099183</span>\n                           <span class=\"entity\">&bull;</span></span>\n                        <span class=\"content\">A very bad lung problem has happened with this drug. Allergic reactions have also happened with this drug. Sometimes, allergic reactions have been life-threatening. These reactions have happened while this drug was given and right after. These reactions can happen with any dose of this drug.</span></li>\n                     <li class=\"statement\">\n                        <span style=\"display:none;\" class=\"attributes\">\n                           <span class=\"link\">urn:lims:b498:s5099184</span>\n                           <span class=\"entity\">&bull;</span></span>\n                        <span class=\"content\">You will be watched closely by your doctor for 30 minutes after each dose. Call your doctor right away if you have chest pain, cough or the need to cough, dizziness, passing out, shortness of breath, sweating, or throat tightness.</span></li>\n                     <li class=\"statement\">\n                        <span style=\"display:none;\" class=\"attributes\">\n                           <span class=\"link\">urn:lims:b498:s5099185</span>\n                           <span class=\"entity\">&bull;</span></span>\n                        <span class=\"content\">You can only get this drug through the Aveed REMS Program.</span></li>\n                     <li class=\"statement\">\n                        <span style=\"display:none;\" class=\"attributes\">\n                           <span class=\"link\">urn:lims:b498:s2810666</span></span>\n                        <span class=\"content\">\n                           <b>\n                              <span style=\"text-decoration: underline\">Skin gel, skin solution:</span></b></span></li>\n                     <li class=\"statement\">\n                        <span style=\"display:none;\" class=\"attributes\">\n                           <span class=\"link\">urn:lims:b498:s2696416</span>\n                           <span class=\"entity\">&bull;</span></span>\n                        <span class=\"content\">Wash the site where the drug was used before it touches anyone else's skin.</span></li>\n                     <li class=\"statement\">\n                        <span style=\"display:none;\" class=\"attributes\">\n                           <span class=\"link\">urn:lims:b498:s2700902</span>\n                           <span class=\"entity\">&bull;</span></span>\n                        <span class=\"content\">Do not let your skin that the gel or solution was used on touch any children's or women's skin. Cover treated part with clothes. Signs of puberty may happen in children.</span></li>\n                     <li class=\"statement\">\n                        <span style=\"display:none;\" class=\"attributes\">\n                           <span class=\"link\">urn:lims:b498:s2697832</span>\n                           <span class=\"entity\">&bull;</span></span>\n                        <span class=\"content\">If a woman or child touches the gel, she/he needs to wash the skin with soap and water.</span></li></ul></div>\r\n<div xmlns=\"http://www.w3.org/1999/xhtml\" id=\"F10028433\" class=\"ord-stmt yya-os drugH1Div\"><span class=\"drugH1\">What is this drug used for?</span>\n                  <ul style=\"list-style-type:none;\" class=\"statements\">\n                     <li class=\"statement\">\n                        <span style=\"display:none;\" class=\"attributes\">\n                           <span class=\"link\">urn:lims:b498:s2691941</span>\n                           <span class=\"entity\">&bull;</span></span>\n                        <span class=\"content\">It is used to treat low testosterone levels.</span></li>\n                     <li class=\"statement\">\n                        <span style=\"display:none;\" class=\"attributes\">\n                           <span class=\"link\">urn:lims:b498:s5094982</span>\n                           <span class=\"entity\">&bull;</span></span>\n                        <span class=\"content\">It is used in certain children when puberty is delayed.</span></li>\n                     <li class=\"statement\">\n                        <span style=\"display:none;\" class=\"attributes\">\n                           <span class=\"link\">urn:lims:b498:s2691763</span>\n                           <span class=\"entity\">&bull;</span></span>\n                        <span class=\"content\">It is used to treat breast cancer in women.</span></li>\n                     <li class=\"statement\">\n                        <span style=\"display:none;\" class=\"attributes\">\n                           <span class=\"link\">urn:lims:b498:s2692146</span>\n                           <span class=\"entity\">&bull;</span></span>\n                        <span class=\"content\">It may be given to you for other reasons. Talk with the doctor.</span></li></ul></div>\r\n<div xmlns=\"http://www.w3.org/1999/xhtml\" id=\"F10028432\" class=\"ord-stmt coi-os drugH1Div\"><span class=\"drugH1\">What do I need to tell my doctor BEFORE I take this drug?</span>\n                  <ul style=\"list-style-type:none;\" class=\"statements\">\n                     <li class=\"statement\">\n                        <span style=\"display:none;\" class=\"attributes\">\n                           <span class=\"link\">urn:lims:b498:s2705324</span></span>\n                        <span class=\"content\">\n                           <b>\n                              <span style=\"text-decoration: underline\">All products:</span></b></span></li>\n                     <li class=\"statement\">\n                        <span style=\"display:none;\" class=\"attributes\">\n                           <span class=\"link\">urn:lims:b498:s2703007</span>\n                           <span class=\"entity\">&bull;</span></span>\n                        <span class=\"content\">If you have an allergy to testosterone or any other part of this drug.</span></li>\n                     <li class=\"statement\">\n                        <span style=\"display:none;\" class=\"attributes\">\n                           <span class=\"link\">urn:lims:b498:s2705171</span>\n                           <span class=\"entity\">&bull;</span></span>\n                        <span class=\"content\">If you are allergic to any drugs like this one, any other drugs, foods, or other substances. Tell your doctor about the allergy and what signs you had, like rash; hives; itching; shortness of breath; wheezing; cough; swelling of face, lips, tongue, or throat; or any other signs.</span></li>\n                     <li class=\"statement\">\n                        <span style=\"display:none;\" class=\"attributes\">\n                           <span class=\"link\">urn:lims:b498:s2701059</span>\n                           <span class=\"entity\">&bull;</span>\n                           <span class=\"gender list\">\n                              <span>Male</span></span></span>\n                        <span class=\"content\">If you are male and have breast or prostate cancer.</span></li>\n                     <li class=\"statement\">\n                        <span style=\"display:none;\" class=\"attributes\">\n                           <span class=\"link\">urn:lims:b498:s4734809</span>\n                           <span class=\"entity\">&bull;</span></span>\n                        <span class=\"content\">If you have any of these health problems: Heart disease, kidney disease, or liver disease.</span></li>\n                     <li class=\"statement\">\n                        <span style=\"display:none;\" class=\"attributes\">\n                           <span class=\"link\">urn:lims:b498:s5586684</span></span>\n                        <span class=\"content\">\n                           <b>\n                              <span style=\"text-decoration: underline\">Testosterone enanthate:</span></b></span></li>\n                     <li class=\"statement\">\n                        <span style=\"display:none;\" class=\"attributes\">\n                           <span class=\"link\">urn:lims:b498:s2701080</span>\n                           <span class=\"entity\">&bull;</span>\n                           <span class=\"gender list\">\n                              <span>Female</span></span></span>\n                        <span class=\"content\">If you are pregnant or may be pregnant. Do not take this drug if you are pregnant.</span></li>\n                     <li class=\"statement\">\n                        <span style=\"display:none;\" class=\"attributes\">\n                           <span class=\"link\">urn:lims:b498:s2701047</span>\n                           <span class=\"entity\">&bull;</span>\n                           <span class=\"gender list\">\n                              <span>Female</span></span></span>\n                        <span class=\"content\">If you are breast-feeding. Do not breast-feed while you take this drug.</span></li>\n                     <li class=\"statement\">\n                        <span style=\"display:none;\" class=\"attributes\">\n                           <span class=\"link\">urn:lims:b498:s2705328</span></span>\n                        <span class=\"content\">\n                           <b>\n                              <span style=\"text-decoration: underline\">All other products:</span></b></span></li>\n                     <li class=\"statement\">\n                        <span style=\"display:none;\" class=\"attributes\">\n                           <span class=\"link\">urn:lims:b498:s6335066</span>\n                           <span class=\"entity\">&bull;</span></span>\n                        <span class=\"content\">If you are a woman. This drug is not approved for use in women. If you are a woman using this drug, talk with your doctor if you are pregnant, plan on getting pregnant, or are breast-feeding.</span></li>\n                     <li class=\"statement\">\n                        <span style=\"display:none;\" class=\"attributes\">\n                           <span class=\"link\">urn:lims:b498:s5455987</span></span>\n                        <span class=\"content\">\n                           <b>\n                              <span style=\"text-decoration: underline\">All products other than injection:</span></b></span></li>\n                     <li class=\"statement\">\n                        <span style=\"display:none;\" class=\"attributes\">\n                           <span class=\"link\">urn:lims:b498:s5720084</span>\n                           <span class=\"entity\">&bull;</span></span>\n                        <span class=\"content\">If the patient is a child. Do not give this drug to a child.</span></li>\n                     <li class=\"statement\">\n                        <span style=\"display:none;\" class=\"attributes\">\n                           <span class=\"link\">urn:lims:b498:s5192622</span></span>\n                        <span class=\"content\">\n                           <b>\n                              <span style=\"text-decoration: underline\">Nose gel:</span></b></span></li>\n                     <li class=\"statement\">\n                        <span style=\"display:none;\" class=\"attributes\">\n                           <span class=\"link\">urn:lims:b498:s5192624</span>\n                           <span class=\"entity\">&bull;</span></span>\n                        <span class=\"content\">If you have problems with swelling of the lining of your nose like Sjogren's syndrome.</span></li>\n                     <li class=\"statement\">\n                        <span style=\"display:none;\" class=\"attributes\">\n                           <span class=\"link\">urn:lims:b498:s5192625</span>\n                           <span class=\"entity\">&bull;</span></span>\n                        <span class=\"content\">If you have ever had any of these health problems: Broken nose within the past 6 months, nose or sinus problems, nose or sinus surgery, or broken nose that caused the inside of the nose to be crooked (deviated septum).</span></li>\n                     <li class=\"statement\">\n                        <span style=\"display:none;\" class=\"attributes\">\n                           <span class=\"link\">urn:lims:b498:s5192626</span>\n                           <span class=\"entity\">&bull;</span></span>\n                        <span class=\"content\">If you are using another drug in the nose.</span></li>\n                     <li class=\"statement\">\n                        <span style=\"display:none;\" class=\"attributes\">\n                           <span class=\"link\">urn:lims:b498:s4194403</span></span>\n                        <span class=\"content\">This is not a list of all drugs or health problems that interact with this drug.</span></li>\n                     <li class=\"statement\">\n                        <span style=\"display:none;\" class=\"attributes\">\n                           <span class=\"link\">urn:lims:b498:s4194405</span></span>\n                        <span class=\"content\">Tell your doctor and pharmacist about all of your drugs (prescription or OTC, natural products, vitamins) and health problems. You must check to make sure that it is safe for you to take this drug with all of your drugs and health problems. Do not start, stop, or change the dose of any drug without checking with your doctor.</span></li></ul></div>\r\n<div xmlns=\"http://www.w3.org/1999/xhtml\" id=\"F10028437\" class=\"ord-stmt yye-os drugH1Div\"><span class=\"drugH1\">What are some things I need to know or do while I take this drug?</span>\n                  <ul style=\"list-style-type:none;\" class=\"statements\">\n                     <li class=\"statement\">\n                        <span style=\"display:none;\" class=\"attributes\">\n                           <span class=\"link\">urn:lims:b259:s2705324</span></span>\n                        <span class=\"content\">\n                           <b>\n                              <span style=\"text-decoration: underline\">All products:</span></b></span></li>\n                     <li class=\"statement\">\n                        <span style=\"display:none;\" class=\"attributes\">\n                           <span class=\"link\">urn:lims:b259:s2697633</span>\n                           <span class=\"entity\">&bull;</span></span>\n                        <span class=\"content\">Tell all of your health care providers that you take this drug. This includes your doctors, nurses, pharmacists, and dentists. </span></li>\n                     <li class=\"statement\">\n                        <span style=\"display:none;\" class=\"attributes\">\n                           <span class=\"link\">urn:lims:b259:s2698524</span>\n                           <span class=\"entity\">&bull;</span></span>\n                        <span class=\"content\">If you have high blood sugar (diabetes), you will need to watch your blood sugar closely.</span></li>\n                     <li class=\"statement\">\n                        <span style=\"display:none;\" class=\"attributes\">\n                           <span class=\"link\">urn:lims:b259:s4727882</span>\n                           <span class=\"entity\">&bull;</span>\n                           <span class=\"gender list\">\n                              <span>Male</span></span></span>\n                        <span class=\"content\">There may be a higher chance of prostate cancer. Talk with the doctor.</span></li>\n                     <li class=\"statement\">\n                        <span style=\"display:none;\" class=\"attributes\">\n                           <span class=\"link\">urn:lims:b259:s5093812</span>\n                           <span class=\"entity\">&bull;</span>\n                           <span class=\"gender list\">\n                              <span>Male</span></span></span>\n                        <span class=\"content\">If you have an enlarged prostate, your signs can get worse while you use this drug. Call your doctor if this happens to you.</span></li>\n                     <li class=\"statement\">\n                        <span style=\"display:none;\" class=\"attributes\">\n                           <span class=\"link\">urn:lims:b259:s5724486</span>\n                           <span class=\"entity\">&bull;</span></span>\n                        <span class=\"content\">High blood pressure has happened with drugs like this one. Have your blood pressure checked as you have been told by your doctor.</span></li>\n                     <li class=\"statement\">\n                        <span style=\"display:none;\" class=\"attributes\">\n                           <span class=\"link\">urn:lims:b259:s6002809</span>\n                           <span class=\"entity\">&bull;</span></span>\n                        <span class=\"content\">Treatment with this drug may lead to higher cholesterol and triglycerides. The effect of these changes on heart health is not known. Talk with the doctor.</span></li>\n                     <li class=\"statement\">\n                        <span style=\"display:none;\" class=\"attributes\">\n                           <span class=\"link\">urn:lims:b259:s2698463</span>\n                           <span class=\"entity\">&bull;</span></span>\n                        <span class=\"content\">Have blood work checked as you have been told by the doctor. Talk with the doctor.</span></li>\n                     <li class=\"statement\">\n                        <span style=\"display:none;\" class=\"attributes\">\n                           <span class=\"link\">urn:lims:b259:s4085520</span>\n                           <span class=\"entity\">&bull;</span></span>\n                        <span class=\"content\">This drug may raise the chance of blood clots, a stroke, or a heart attack. Talk with the doctor.</span></li>\n                     <li class=\"statement\">\n                        <span style=\"display:none;\" class=\"attributes\">\n                           <span class=\"link\">urn:lims:b259:s6335068</span>\n                           <span class=\"entity\">&bull;</span></span>\n                        <span class=\"content\">This drug is an anabolic steroid. Anabolic steroid drugs have been abused and misused before. Anabolic steroid abuse can lead to dependence and very bad health problems. These health problems include heart or blood vessel problems, stroke, liver problems, and mental or mood problems. Talk with the doctor.</span></li>\n                     <li class=\"statement\">\n                        <span style=\"display:none;\" class=\"attributes\">\n                           <span class=\"link\">urn:lims:b259:s2697004</span>\n                           <span class=\"entity\">&bull;</span></span>\n                        <span class=\"content\">If you are 65 or older, use this drug with care. You could have more side effects.</span></li>\n                     <li class=\"statement\">\n                        <span style=\"display:none;\" class=\"attributes\">\n                           <span class=\"link\">urn:lims:b259:s5586676</span>\n                           <span class=\"entity\">&bull;</span></span>\n                        <span class=\"content\">This drug is not approved for treating low testosterone levels caused by getting older. Talk with your doctor.</span></li>\n                     <li class=\"statement\">\n                        <span style=\"display:none;\" class=\"attributes\">\n                           <span class=\"link\">urn:lims:b259:s4717031</span>\n                           <span class=\"entity\">&bull;</span>\n                           <span class=\"gender list\">\n                              <span>Male</span></span></span>\n                        <span class=\"content\">This drug may affect sperm in men. This may affect being able to father a child. Talk with the doctor.</span></li>\n                     <li class=\"statement\">\n                        <span style=\"display:none;\" class=\"attributes\">\n                           <span class=\"link\">urn:lims:b259:s2810666</span></span>\n                        <span class=\"content\">\n                           <b>\n                              <span style=\"text-decoration: underline\">Skin gel, skin solution:</span></b></span></li>\n                     <li class=\"statement\">\n                        <span style=\"display:none;\" class=\"attributes\">\n                           <span class=\"link\">urn:lims:b259:s5093762</span>\n                           <span class=\"entity\">&bull;</span></span>\n                        <span class=\"content\">Tell the doctor right away if a child or woman touches the gel or solution and has any bad effects. In children, these are forceful actions, enlarged sex organs, and early growth of pubic hair. In women, these are a deep voice, change in body hair, or pimples.</span></li>\n                     <li class=\"statement\">\n                        <span style=\"display:none;\" class=\"attributes\">\n                           <span class=\"link\">urn:lims:b259:s5093763</span>\n                           <span class=\"entity\">&bull;</span></span>\n                        <span class=\"content\">If a pregnant woman touches the gel or solution, call the doctor right away.</span></li>\n                     <li class=\"statement\">\n                        <span style=\"display:none;\" class=\"attributes\">\n                           <span class=\"link\">urn:lims:b259:s5192622</span></span>\n                        <span class=\"content\">\n                           <b>\n                              <span style=\"text-decoration: underline\">Nose gel:</span></b></span></li>\n                     <li class=\"statement\">\n                        <span style=\"display:none;\" class=\"attributes\">\n                           <span class=\"link\">urn:lims:b259:s5192627</span>\n                           <span class=\"entity\">&bull;</span></span>\n                        <span class=\"content\">If you have very bad nose problems like runny nose, stuffy nose, or postnasal drip, or if you have these problems and they do not go away, talk with your doctor. You may need to stop this drug or switch to another product.</span></li>\n                     <li class=\"statement\">\n                        <span style=\"display:none;\" class=\"attributes\">\n                           <span class=\"link\">urn:lims:b259:s2705500</span></span>\n                        <span class=\"content\">\n                           <b>\n                              <span style=\"text-decoration: underline\">Patch:</span></b></span></li>\n                     <li class=\"statement\">\n                        <span style=\"display:none;\" class=\"attributes\">\n                           <span class=\"link\">urn:lims:b259:s2697650</span>\n                           <span class=\"entity\">&bull;</span></span>\n                        <span class=\"content\">The patch may have metal. Take off the patch before an MRI.</span></li>\n                     <li class=\"statement\">\n                        <span style=\"display:none;\" class=\"attributes\">\n                           <span class=\"link\">urn:lims:b259:s2705346</span></span>\n                        <span class=\"content\">\n                           <b>\n                              <span style=\"text-decoration: underline\">Cheek tablet:</span></b></span></li>\n                     <li class=\"statement\">\n                        <span style=\"display:none;\" class=\"attributes\">\n                           <span class=\"link\">urn:lims:b259:s5094142</span>\n                           <span class=\"entity\">&bull;</span></span>\n                        <span class=\"content\">Be sure to inspect your gums where you put this drug on a regular basis. Talk with your doctor.</span></li>\n                     <li class=\"statement\">\n                        <span style=\"display:none;\" class=\"attributes\">\n                           <span class=\"link\">urn:lims:b259:s5099182</span></span>\n                        <span class=\"content\">\n                           <b>\n                              <span style=\"text-decoration: underline\">Testosterone undecanoate:</span></b></span></li>\n                     <li class=\"statement\">\n                        <span style=\"display:none;\" class=\"attributes\">\n                           <span class=\"link\">urn:lims:b259:s4468886</span>\n                           <span class=\"entity\">&bull;</span></span>\n                        <span class=\"content\">This drug is not approved for use in children. Talk with the doctor.</span></li>\n                     <li class=\"statement\">\n                        <span style=\"display:none;\" class=\"attributes\">\n                           <span class=\"link\">urn:lims:b259:s6335069</span></span>\n                        <span class=\"content\">\n                           <span style=\"text-decoration: underline\">\n                              <b>All other injection products:</b></span></span></li>\n                     <li class=\"statement\">\n                        <span style=\"display:none;\" class=\"attributes\">\n                           <span class=\"link\">urn:lims:b259:s5094883</span>\n                           <span class=\"entity\">&bull;</span></span>\n                        <span class=\"content\">Some drugs may be used in children. Use care if this drug is given to a child. Talk with the doctor to see if this drug may be used in children. Talk with the doctor if you have questions about giving this drug to a child.</span></li>\n                     <li class=\"statement\">\n                        <span style=\"display:none;\" class=\"attributes\">\n                           <span class=\"link\">urn:lims:b259:s2700978</span>\n                           <span class=\"entity\">&bull;</span></span>\n                        <span class=\"content\">Some products have benzyl alcohol. Do not give a product that has benzyl alcohol in it to a newborn or infant. Talk with the doctor to see if this product has benzyl alcohol in it.</span></li>\n                     <li class=\"statement\">\n                        <span style=\"display:none;\" class=\"attributes\">\n                           <span class=\"link\">urn:lims:b259:s2698550</span>\n                           <span class=\"entity\">&bull;</span></span>\n                        <span class=\"content\">This drug may affect growth in children and teens in some cases. They may need regular growth checks. Talk with the doctor.</span></li></ul></div>\r\n<div xmlns=\"http://www.w3.org/1999/xhtml\" id=\"F10028440\" class=\"ord-stmt yyh-os drugH1Div\"><span class=\"drugH1\">What are some side effects that I need to call my doctor about right away?</span>\n                  <ul style=\"list-style-type:none;\" class=\"statements\">\n                     <li class=\"statement\">\n                        <span style=\"display:none;\" class=\"attributes\">\n                           <span class=\"link\">urn:lims:b498:s4186185</span></span>\n                        <span class=\"content\">\n                           <b>WARNING/CAUTION:</b> Even though it may be rare, some people may have very bad and sometimes deadly side effects when taking a drug. Tell your doctor or get medical help right away if you have any of the following signs or symptoms that may be related to a very bad side effect:</span></li>\n                     <li class=\"statement\">\n                        <span style=\"display:none;\" class=\"attributes\">\n                           <span class=\"link\">urn:lims:b498:s2705324</span></span>\n                        <span class=\"content\">\n                           <b>\n                              <span style=\"text-decoration: underline\">All products:</span></b></span></li>\n                     <li class=\"statement\">\n                        <span style=\"display:none;\" class=\"attributes\">\n                           <span class=\"link\">urn:lims:b498:s2699066</span>\n                           <span class=\"entity\">&bull;</span></span>\n                        <span class=\"content\">Signs of an allergic reaction, like rash; hives; itching; red, swollen, blistered, or peeling skin with or without fever; wheezing; tightness in the chest or throat; trouble breathing, swallowing, or talking; unusual hoarseness; or swelling of the mouth, face, lips, tongue, or throat.</span></li>\n                     <li class=\"statement\">\n                        <span style=\"display:none;\" class=\"attributes\">\n                           <span class=\"link\">urn:lims:b498:s5039881</span>\n                           <span class=\"entity\">&bull;</span></span>\n                        <span class=\"content\">Signs of high blood pressure like very bad headache or dizziness, passing out, or change in eyesight.</span></li>\n                     <li class=\"statement\">\n                        <span style=\"display:none;\" class=\"attributes\">\n                           <span class=\"link\">urn:lims:b498:s5072925</span>\n                           <span class=\"entity\">&bull;</span></span>\n                        <span class=\"content\">Signs of high calcium levels like weakness, confusion, feeling tired, headache, upset stomach and throwing up, hard stools (constipation), or bone pain.</span></li>\n                     <li class=\"statement\">\n                        <span style=\"display:none;\" class=\"attributes\">\n                           <span class=\"link\">urn:lims:b498:s5007447</span>\n                           <span class=\"entity\">&bull;</span>\n                           <span class=\"gender list\">\n                              <span>Male</span></span></span>\n                        <span class=\"content\">For males, erections (hard penis) that happen often or that last a long time.</span></li>\n                     <li class=\"statement\">\n                        <span style=\"display:none;\" class=\"attributes\">\n                           <span class=\"link\">urn:lims:b498:s2698103</span>\n                           <span class=\"entity\">&bull;</span></span>\n                        <span class=\"content\">Passing urine more often.</span></li>\n                     <li class=\"statement\">\n                        <span style=\"display:none;\" class=\"attributes\">\n                           <span class=\"link\">urn:lims:b498:s2698012</span>\n                           <span class=\"entity\">&bull;</span></span>\n                        <span class=\"content\">Trouble passing urine.</span></li>\n                     <li class=\"statement\">\n                        <span style=\"display:none;\" class=\"attributes\">\n                           <span class=\"link\">urn:lims:b498:s5929513</span>\n                           <span class=\"entity\">&bull;</span></span>\n                        <span class=\"content\">Passing urine in a weak stream or drips.</span></li>\n                     <li class=\"statement\">\n                        <span style=\"display:none;\" class=\"attributes\">\n                           <span class=\"link\">urn:lims:b498:s5849900</span>\n                           <span class=\"entity\">&bull;</span></span>\n                        <span class=\"content\">Not able to control passing urine.</span></li>\n                     <li class=\"statement\">\n                        <span style=\"display:none;\" class=\"attributes\">\n                           <span class=\"link\">urn:lims:b498:s2698236</span>\n                           <span class=\"entity\">&bull;</span></span>\n                        <span class=\"content\">Mood changes.</span></li>\n                     <li class=\"statement\">\n                        <span style=\"display:none;\" class=\"attributes\">\n                           <span class=\"link\">urn:lims:b498:s2697997</span>\n                           <span class=\"entity\">&bull;</span></span>\n                        <span class=\"content\">Low mood (depression).</span></li>\n                     <li class=\"statement\">\n                        <span style=\"display:none;\" class=\"attributes\">\n                           <span class=\"link\">urn:lims:b498:s4647915</span>\n                           <span class=\"entity\">&bull;</span></span>\n                        <span class=\"content\">Change in how you act.</span></li>\n                     <li class=\"statement\">\n                        <span style=\"display:none;\" class=\"attributes\">\n                           <span class=\"link\">urn:lims:b498:s2697923</span>\n                           <span class=\"entity\">&bull;</span></span>\n                        <span class=\"content\">Enlarged breasts.</span></li>\n                     <li class=\"statement\">\n                        <span style=\"display:none;\" class=\"attributes\">\n                           <span class=\"link\">urn:lims:b498:s2697924</span>\n                           <span class=\"entity\">&bull;</span></span>\n                        <span class=\"content\">Breast pain.</span></li>\n                     <li class=\"statement\">\n                        <span style=\"display:none;\" class=\"attributes\">\n                           <span class=\"link\">urn:lims:b498:s4193665</span>\n                           <span class=\"entity\">&bull;</span></span>\n                        <span class=\"content\">Shortness of breath, a big weight gain, or swelling in the arms or legs.</span></li>\n                     <li class=\"statement\">\n                        <span style=\"display:none;\" class=\"attributes\">\n                           <span class=\"link\">urn:lims:b498:s2698261</span>\n                           <span class=\"entity\">&bull;</span></span>\n                        <span class=\"content\">Upset stomach or throwing up.</span></li>\n                     <li class=\"statement\">\n                        <span style=\"display:none;\" class=\"attributes\">\n                           <span class=\"link\">urn:lims:b498:s5093810</span>\n                           <span class=\"entity\">&bull;</span></span>\n                        <span class=\"content\">Trouble breathing when sleeping.</span></li>\n                     <li class=\"statement\">\n                        <span style=\"display:none;\" class=\"attributes\">\n                           <span class=\"link\">urn:lims:b498:s6335072</span>\n                           <span class=\"entity\">&bull;</span></span>\n                        <span class=\"content\">Feeling sleepy during the day.</span></li>\n                     <li class=\"statement\">\n                        <span style=\"display:none;\" class=\"attributes\">\n                           <span class=\"link\">urn:lims:b498:s2698619</span>\n                           <span class=\"entity\">&bull;</span></span>\n                        <span class=\"content\">Weakness on 1 side of the body, trouble speaking or thinking, change in balance, drooping on one side of the face, or blurred eyesight.</span></li>\n                     <li class=\"statement\">\n                        <span style=\"display:none;\" class=\"attributes\">\n                           <span class=\"link\">urn:lims:b498:s2697946</span>\n                           <span class=\"entity\">&bull;</span></span>\n                        <span class=\"content\">Change in color of skin.</span></li>\n                     <li class=\"statement\">\n                        <span style=\"display:none;\" class=\"attributes\">\n                           <span class=\"link\">urn:lims:b498:s5093811</span>\n                           <span class=\"entity\">&bull;</span>\n                           <span class=\"gender list\">\n                              <span>Male</span></span></span>\n                        <span class=\"content\">Change in size or shape of testicles.</span></li>\n                     <li class=\"statement\">\n                        <span style=\"display:none;\" class=\"attributes\">\n                           <span class=\"link\">urn:lims:b498:s5092882</span>\n                           <span class=\"entity\">&bull;</span></span>\n                        <span class=\"content\">Very bad irritation where this drug is used.</span></li>\n                     <li class=\"statement\">\n                        <span style=\"display:none;\" class=\"attributes\">\n                           <span class=\"link\">urn:lims:b498:s5656499</span>\n                           <span class=\"entity\">&bull;</span></span>\n                        <span class=\"content\">Call your doctor right away if you have signs of a blood clot like chest pain or pressure; coughing up blood; shortness of breath; swelling, warmth, numbness, change of color, or pain in a leg or arm; or trouble speaking or swallowing.</span></li>\n                     <li class=\"statement\">\n                        <span style=\"display:none;\" class=\"attributes\">\n                           <span class=\"link\">urn:lims:b498:s5969701</span>\n                           <span class=\"entity\">&bull;</span></span>\n                        <span class=\"content\">Liver problems have happened with drugs like this one. Sometimes, this has been deadly. Call your doctor right away if you have signs of liver problems like dark urine, feeling tired, not hungry, upset stomach or stomach pain, light-colored stools, throwing up, or yellow skin or eyes.</span></li>\n                     <li class=\"statement\">\n                        <span style=\"display:none;\" class=\"attributes\">\n                           <span class=\"link\">urn:lims:b498:s5192622</span></span>\n                        <span class=\"content\">\n                           <b>\n                              <span style=\"text-decoration: underline\">Nose gel:</span></b></span></li>\n                     <li class=\"statement\">\n                        <span style=\"display:none;\" class=\"attributes\">\n                           <span class=\"link\">urn:lims:b498:s2698280</span>\n                           <span class=\"entity\">&bull;</span></span>\n                        <span class=\"content\">Nosebleed.</span></li>\n                     <li class=\"statement\">\n                        <span style=\"display:none;\" class=\"attributes\">\n                           <span class=\"link\">urn:lims:b498:s4646784</span>\n                           <span class=\"entity\">&bull;</span></span>\n                        <span class=\"content\">Dry nose.</span></li>\n                     <li class=\"statement\">\n                        <span style=\"display:none;\" class=\"attributes\">\n                           <span class=\"link\">urn:lims:b498:s3445775</span>\n                           <span class=\"entity\">&bull;</span></span>\n                        <span class=\"content\">Nose pain or irritation.</span></li>\n                     <li class=\"statement\">\n                        <span style=\"display:none;\" class=\"attributes\">\n                           <span class=\"link\">urn:lims:b498:s2698316</span>\n                           <span class=\"entity\">&bull;</span></span>\n                        <span class=\"content\">Runny nose.</span></li>\n                     <li class=\"statement\">\n                        <span style=\"display:none;\" class=\"attributes\">\n                           <span class=\"link\">urn:lims:b498:s2698358</span>\n                           <span class=\"entity\">&bull;</span></span>\n                        <span class=\"content\">Stuffy nose.</span></li>\n                     <li class=\"statement\">\n                        <span style=\"display:none;\" class=\"attributes\">\n                           <span class=\"link\">urn:lims:b498:s5192628</span>\n                           <span class=\"entity\">&bull;</span></span>\n                        <span class=\"content\">Nose scabs.</span></li>\n                     <li class=\"statement\">\n                        <span style=\"display:none;\" class=\"attributes\">\n                           <span class=\"link\">urn:lims:b498:s4131956</span>\n                           <span class=\"entity\">&bull;</span></span>\n                        <span class=\"content\">Sneezing.</span></li>\n                     <li class=\"statement\">\n                        <span style=\"display:none;\" class=\"attributes\">\n                           <span class=\"link\">urn:lims:b498:s2705346</span></span>\n                        <span class=\"content\">\n                           <b>\n                              <span style=\"text-decoration: underline\">Cheek tablet:</span></b></span></li>\n                     <li class=\"statement\">\n                        <span style=\"display:none;\" class=\"attributes\">\n                           <span class=\"link\">urn:lims:b498:s2698110</span>\n                           <span class=\"entity\">&bull;</span></span>\n                        <span class=\"content\">Gum changes.</span></li>\n                     <li class=\"statement\">\n                        <span style=\"display:none;\" class=\"attributes\">\n                           <span class=\"link\">urn:lims:b498:s6335073</span></span>\n                        <span class=\"content\">\n                           <b>\n                              <span style=\"text-decoration: underline\">Injection (when used in females):</span></b></span></li>\n                     <li class=\"statement\">\n                        <span style=\"display:none;\" class=\"attributes\">\n                           <span class=\"link\">urn:lims:b498:s2698664</span>\n                           <span class=\"entity\">&bull;</span>\n                           <span class=\"gender list\">\n                              <span>Female</span></span></span>\n                        <span class=\"content\">For females, a deep voice, facial hair, pimples, or period changes.</span></li></ul></div>\r\n<div xmlns=\"http://www.w3.org/1999/xhtml\" id=\"F10028438\" class=\"ord-stmt yyf-os drugH1Div\"><span class=\"drugH1\">What are some other side effects of this drug?</span>\n                  <ul style=\"list-style-type:none;\" class=\"statements\">\n                     <li class=\"statement\">\n                        <span style=\"display:none;\" class=\"attributes\">\n                           <span class=\"link\">urn:lims:b498:s4186184</span></span>\n                        <span class=\"content\">All drugs may cause side effects. However, many people have no side effects or only have minor side effects. Call your doctor or get medical help if any of these side effects or any other side effects bother you or do not go away:</span></li>\n                     <li class=\"statement\">\n                        <span style=\"display:none;\" class=\"attributes\">\n                           <span class=\"link\">urn:lims:b498:s2705324</span></span>\n                        <span class=\"content\">\n                           <b>\n                              <span style=\"text-decoration: underline\">All products:</span></b></span></li>\n                     <li class=\"statement\">\n                        <span style=\"display:none;\" class=\"attributes\">\n                           <span class=\"link\">urn:lims:b498:s2698119</span>\n                           <span class=\"entity\">&bull;</span></span>\n                        <span class=\"content\">Headache.</span></li>\n                     <li class=\"statement\">\n                        <span style=\"display:none;\" class=\"attributes\">\n                           <span class=\"link\">urn:lims:b498:s2696435</span>\n                           <span class=\"entity\">&bull;</span></span>\n                        <span class=\"content\">Pimples (acne).</span></li>\n                     <li class=\"statement\">\n                        <span style=\"display:none;\" class=\"attributes\">\n                           <span class=\"link\">urn:lims:b498:s2697998</span>\n                           <span class=\"entity\">&bull;</span></span>\n                        <span class=\"content\">Loose stools (diarrhea).</span></li>\n                     <li class=\"statement\">\n                        <span style=\"display:none;\" class=\"attributes\">\n                           <span class=\"link\">urn:lims:b498:s2698036</span>\n                           <span class=\"entity\">&bull;</span></span>\n                        <span class=\"content\">Emotional ups and downs.</span></li>\n                     <li class=\"statement\">\n                        <span style=\"display:none;\" class=\"attributes\">\n                           <span class=\"link\">urn:lims:b498:s2698074</span>\n                           <span class=\"entity\">&bull;</span></span>\n                        <span class=\"content\">Feeling tired or weak.</span></li>\n                     <li class=\"statement\">\n                        <span style=\"display:none;\" class=\"attributes\">\n                           <span class=\"link\">urn:lims:b498:s2698162</span>\n                           <span class=\"entity\">&bull;</span></span>\n                        <span class=\"content\">Not able to sleep.</span></li>\n                     <li class=\"statement\">\n                        <span style=\"display:none;\" class=\"attributes\">\n                           <span class=\"link\">urn:lims:b498:s4642383</span>\n                           <span class=\"entity\">&bull;</span></span>\n                        <span class=\"content\">Irritation where this drug is used.</span></li>\n                     <li class=\"statement\">\n                        <span style=\"display:none;\" class=\"attributes\">\n                           <span class=\"link\">urn:lims:b498:s5192622</span></span>\n                        <span class=\"content\">\n                           <b>\n                              <span style=\"text-decoration: underline\">Nose gel:</span></b></span></li>\n                     <li class=\"statement\">\n                        <span style=\"display:none;\" class=\"attributes\">\n                           <span class=\"link\">urn:lims:b498:s2697983</span>\n                           <span class=\"entity\">&bull;</span></span>\n                        <span class=\"content\">Cough.</span></li>\n                     <li class=\"statement\">\n                        <span style=\"display:none;\" class=\"attributes\">\n                           <span class=\"link\">urn:lims:b498:s2698371</span>\n                           <span class=\"entity\">&bull;</span></span>\n                        <span class=\"content\">Throat irritation.</span></li>\n                     <li class=\"statement\">\n                        <span style=\"display:none;\" class=\"attributes\">\n                           <span class=\"link\">urn:lims:b498:s2705346</span></span>\n                        <span class=\"content\">\n                           <b>\n                              <span style=\"text-decoration: underline\">Cheek tablet:</span></b></span></li>\n                     <li class=\"statement\">\n                        <span style=\"display:none;\" class=\"attributes\">\n                           <span class=\"link\">urn:lims:b498:s2697934</span>\n                           <span class=\"entity\">&bull;</span></span>\n                        <span class=\"content\">Change in taste.</span></li>\n                     <li class=\"statement\">\n                        <span style=\"display:none;\" class=\"attributes\">\n                           <span class=\"link\">urn:lims:b498:s2696431</span>\n                           <span class=\"entity\">&bull;</span></span>\n                        <span class=\"content\">Bad taste in your mouth.</span></li>\n                     <li class=\"statement\">\n                        <span style=\"display:none;\" class=\"attributes\">\n                           <span class=\"link\">urn:lims:b498:s2705500</span></span>\n                        <span class=\"content\">\n                           <b>\n                              <span style=\"text-decoration: underline\">Patch:</span></b></span></li>\n                     <li class=\"statement\">\n                        <span style=\"display:none;\" class=\"attributes\">\n                           <span class=\"link\">urn:lims:b498:s2697883</span>\n                           <span class=\"entity\">&bull;</span></span>\n                        <span class=\"content\">Back pain.</span></li>\n                     <li class=\"statement\">\n                        <span style=\"display:none;\" class=\"attributes\">\n                           <span class=\"link\">urn:lims:b498:s5005902</span></span>\n                        <span class=\"content\">\n                           <b>\n                              <span style=\"text-decoration: underline\">All injection products:</span></b></span></li>\n                     <li class=\"statement\">\n                        <span style=\"display:none;\" class=\"attributes\">\n                           <span class=\"link\">urn:lims:b498:s2698991</span>\n                           <span class=\"entity\">&bull;</span></span>\n                        <span class=\"content\">Pain where the shot was given.</span></li>\n                     <li class=\"statement\">\n                        <span style=\"display:none;\" class=\"attributes\">\n                           <span class=\"link\">urn:lims:b498:s2699671</span></span>\n                        <span class=\"content\">These are not all of the side effects that may occur. If you have questions about side effects, call your doctor. Call your doctor for medical advice about side effects.</span></li>\n                     <li class=\"statement\">\n                        <span style=\"display:none;\" class=\"attributes\">\n                           <span class=\"link\">urn:lims:b498:s4577343</span>\n                           <span class=\"country-exclude list\">\n                              <span>US</span></span></span>\n                        <span class=\"content\">You may report side effects to your national health agency.</span></li></ul></div>\r\n<div xmlns=\"http://www.w3.org/1999/xhtml\" id=\"F10028435\" class=\"ord-stmt yyc-os drugH1Div\"><span class=\"drugH1\">How is this drug best taken?</span>\n                  <ul style=\"list-style-type:none;\" class=\"statements\">\n                     <li class=\"statement\">\n                        <span style=\"display:none;\" class=\"attributes\">\n                           <span class=\"link\">urn:lims:b498:s2696083</span></span>\n                        <span class=\"content\">Use this drug as ordered by your doctor. Read all information given to you. Follow all instructions closely.</span></li>\n                     <li class=\"statement\">\n                        <span style=\"display:none;\" class=\"attributes\">\n                           <span class=\"link\">urn:lims:b498:s2705324</span></span>\n                        <span class=\"content\">\n                           <b>\n                              <span style=\"text-decoration: underline\">All products:</span></b></span></li>\n                     <li class=\"statement\">\n                        <span style=\"display:none;\" class=\"attributes\">\n                           <span class=\"link\">urn:lims:b498:s4194396</span>\n                           <span class=\"entity\">&bull;</span></span>\n                        <span class=\"content\">This drug may affect certain lab tests. Tell all of your health care providers and lab workers that you take this drug.</span></li>\n                     <li class=\"statement\">\n                        <span style=\"display:none;\" class=\"attributes\">\n                           <span class=\"link\">urn:lims:b498:s5948293</span>\n                           <span class=\"entity\">&bull;</span></span>\n                        <span class=\"content\">If you are taking warfarin, talk with your doctor. You may need to have your blood work checked more closely while you are taking it with this drug.</span></li>\n                     <li class=\"statement\">\n                        <span style=\"display:none;\" class=\"attributes\">\n                           <span class=\"link\">urn:lims:b498:s2696257</span>\n                           <span class=\"entity\">&bull;</span></span>\n                        <span class=\"content\">Wash your hands before and after use.</span></li>\n                     <li class=\"statement\">\n                        <span style=\"display:none;\" class=\"attributes\">\n                           <span class=\"link\">urn:lims:b498:s5455987</span></span>\n                        <span class=\"content\">\n                           <b>\n                              <span style=\"text-decoration: underline\">All products other than injection:</span></b></span></li>\n                     <li class=\"statement\">\n                        <span style=\"display:none;\" class=\"attributes\">\n                           <span class=\"link\">urn:lims:b498:s2694870</span>\n                           <span class=\"entity\">&bull;</span></span>\n                        <span class=\"content\">Follow how to use as you have been told by the doctor or read the package insert.</span></li>\n                     <li class=\"statement\">\n                        <span style=\"display:none;\" class=\"attributes\">\n                           <span class=\"link\">urn:lims:b498:s2810666</span></span>\n                        <span class=\"content\">\n                           <b>\n                              <span style=\"text-decoration: underline\">Skin gel, skin solution:</span></b></span></li>\n                     <li class=\"statement\">\n                        <span style=\"display:none;\" class=\"attributes\">\n                           <span class=\"link\">urn:lims:b498:s4638602</span>\n                           <span class=\"entity\">&bull;</span></span>\n                        <span class=\"content\">Do not take this drug by mouth. Use on your skin only.</span></li>\n                     <li class=\"statement\">\n                        <span style=\"display:none;\" class=\"attributes\">\n                           <span class=\"link\">urn:lims:b498:s4973142</span>\n                           <span class=\"entity\">&bull;</span></span>\n                        <span class=\"content\">Use this drug at the same time of day.</span></li>\n                     <li class=\"statement\">\n                        <span style=\"display:none;\" class=\"attributes\">\n                           <span class=\"link\">urn:lims:b498:s4728077</span>\n                           <span class=\"entity\">&bull;</span></span>\n                        <span class=\"content\">Not all products are the same strength. Read and follow label carefully.</span></li>\n                     <li class=\"statement\">\n                        <span style=\"display:none;\" class=\"attributes\">\n                           <span class=\"link\">urn:lims:b498:s3656449</span>\n                           <span class=\"entity\">&bull;</span></span>\n                        <span class=\"content\">Do not get this drug on other parts of your body or on other people.</span></li>\n                     <li class=\"statement\">\n                        <span style=\"display:none;\" class=\"attributes\">\n                           <span class=\"link\">urn:lims:b498:s2998401</span>\n                           <span class=\"entity\">&bull;</span></span>\n                        <span class=\"content\">Do not put on the genitals.</span></li>\n                     <li class=\"statement\">\n                        <span style=\"display:none;\" class=\"attributes\">\n                           <span class=\"link\">urn:lims:b498:s2695258</span>\n                           <span class=\"entity\">&bull;</span></span>\n                        <span class=\"content\">Keep out of your eyes.</span></li>\n                     <li class=\"statement\">\n                        <span style=\"display:none;\" class=\"attributes\">\n                           <span class=\"link\">urn:lims:b498:s5095042</span>\n                           <span class=\"entity\">&bull;</span></span>\n                        <span class=\"content\">Some products come in pumps. Some products come in packets. If you are using a pump, you will need to prime it before you use it the first time. Prime the pump as you are told in the package insert.</span></li>\n                     <li class=\"statement\">\n                        <span style=\"display:none;\" class=\"attributes\">\n                           <span class=\"link\">urn:lims:b498:s5095044</span>\n                           <span class=\"entity\">&bull;</span></span>\n                        <span class=\"content\">After putting this drug on, you will need to wait some time before you bathe, shower, or swim. Be sure you know how long you need to wait. Read the package insert for more details.</span></li>\n                     <li class=\"statement\">\n                        <span style=\"display:none;\" class=\"attributes\">\n                           <span class=\"link\">urn:lims:b498:s2694407</span>\n                           <span class=\"entity\">&bull;</span></span>\n                        <span class=\"content\">Let dry before covering with clothing.</span></li>\n                     <li class=\"statement\">\n                        <span style=\"display:none;\" class=\"attributes\">\n                           <span class=\"link\">urn:lims:b498:s2694538</span>\n                           <span class=\"entity\">&bull;</span></span>\n                        <span class=\"content\">Avoid fire, flames, or smoking until dry.</span></li>\n                     <li class=\"statement\">\n                        <span style=\"display:none;\" class=\"attributes\">\n                           <span class=\"link\">urn:lims:b498:s2705537</span></span>\n                        <span class=\"content\">\n                           <b>\n                              <span style=\"text-decoration: underline\">Skin gel:</span></b></span></li>\n                     <li class=\"statement\">\n                        <span style=\"display:none;\" class=\"attributes\">\n                           <span class=\"link\">urn:lims:b498:s2694513</span>\n                           <span class=\"entity\">&bull;</span></span>\n                        <span class=\"content\">Put on clean, dry, healthy skin.</span></li>\n                     <li class=\"statement\">\n                        <span style=\"display:none;\" class=\"attributes\">\n                           <span class=\"link\">urn:lims:b498:s5095043</span>\n                           <span class=\"entity\">&bull;</span></span>\n                        <span class=\"content\">Certain products are to be put on certain parts of the body. Be sure you know where to put this drug. Read the package insert for more details.</span></li>\n                     <li class=\"statement\">\n                        <span style=\"display:none;\" class=\"attributes\">\n                           <span class=\"link\">urn:lims:b498:s2810659</span></span>\n                        <span class=\"content\">\n                           <b>\n                              <span style=\"text-decoration: underline\">Skin solution:</span></b></span></li>\n                     <li class=\"statement\">\n                        <span style=\"display:none;\" class=\"attributes\">\n                           <span class=\"link\">urn:lims:b498:s2998419</span>\n                           <span class=\"entity\">&bull;</span></span>\n                        <span class=\"content\">Put on clean, dry, healthy skin using the applicator under the arm.</span></li>\n                     <li class=\"statement\">\n                        <span style=\"display:none;\" class=\"attributes\">\n                           <span class=\"link\">urn:lims:b498:s4734526</span>\n                           <span class=\"entity\">&bull;</span></span>\n                        <span class=\"content\">Do not use your fingers or hand to rub this drug into the skin.</span></li>\n                     <li class=\"statement\">\n                        <span style=\"display:none;\" class=\"attributes\">\n                           <span class=\"link\">urn:lims:b498:s4734527</span>\n                           <span class=\"entity\">&bull;</span></span>\n                        <span class=\"content\">Change armpits with each dose.</span></li>\n                     <li class=\"statement\">\n                        <span style=\"display:none;\" class=\"attributes\">\n                           <span class=\"link\">urn:lims:b498:s4734528</span>\n                           <span class=\"entity\">&bull;</span></span>\n                        <span class=\"content\">Allow skin to dry between uses.</span></li>\n                     <li class=\"statement\">\n                        <span style=\"display:none;\" class=\"attributes\">\n                           <span class=\"link\">urn:lims:b498:s4734542</span>\n                           <span class=\"entity\">&bull;</span></span>\n                        <span class=\"content\">If you use an antiperspirant or deodorant, put on at least 2 minutes before you put on this drug.</span></li>\n                     <li class=\"statement\">\n                        <span style=\"display:none;\" class=\"attributes\">\n                           <span class=\"link\">urn:lims:b498:s5192622</span></span>\n                        <span class=\"content\">\n                           <b>\n                              <span style=\"text-decoration: underline\">Nose gel:</span></b></span></li>\n                     <li class=\"statement\">\n                        <span style=\"display:none;\" class=\"attributes\">\n                           <span class=\"link\">urn:lims:b498:s2694774</span>\n                           <span class=\"entity\">&bull;</span></span>\n                        <span class=\"content\">Do not take this drug by mouth. Use in your nose only. Keep out of your mouth and eyes (may burn).</span></li>\n                     <li class=\"statement\">\n                        <span style=\"display:none;\" class=\"attributes\">\n                           <span class=\"link\">urn:lims:b498:s4862623</span>\n                           <span class=\"entity\">&bull;</span></span>\n                        <span class=\"content\">If you get this drug on the skin, wash it off right away with soap and water.</span></li>\n                     <li class=\"statement\">\n                        <span style=\"display:none;\" class=\"attributes\">\n                           <span class=\"link\">urn:lims:b498:s4973142</span>\n                           <span class=\"entity\">&bull;</span></span>\n                        <span class=\"content\">Use this drug at the same time of day.</span></li>\n                     <li class=\"statement\">\n                        <span style=\"display:none;\" class=\"attributes\">\n                           <span class=\"link\">urn:lims:b498:s5192629</span>\n                           <span class=\"entity\">&bull;</span></span>\n                        <span class=\"content\">You will need to prime the pump before first use. Do this by turning it upside down and pressing down on the pump 10 times. If any drug comes out during priming, wash down the sink with warm water.</span></li>\n                     <li class=\"statement\">\n                        <span style=\"display:none;\" class=\"attributes\">\n                           <span class=\"link\">urn:lims:b498:s2694567</span>\n                           <span class=\"entity\">&bull;</span></span>\n                        <span class=\"content\">Blow your nose before use.</span></li>\n                     <li class=\"statement\">\n                        <span style=\"display:none;\" class=\"attributes\">\n                           <span class=\"link\">urn:lims:b498:s5192630</span>\n                           <span class=\"entity\">&bull;</span></span>\n                        <span class=\"content\">Do not blow your nose or sniff for 1 hour after using this drug.</span></li>\n                     <li class=\"statement\">\n                        <span style=\"display:none;\" class=\"attributes\">\n                           <span class=\"link\">urn:lims:b498:s4788836</span>\n                           <span class=\"entity\">&bull;</span></span>\n                        <span class=\"content\">Follow how to clean carefully.</span></li>\n                     <li class=\"statement\">\n                        <span style=\"display:none;\" class=\"attributes\">\n                           <span class=\"link\">urn:lims:b498:s2705500</span></span>\n                        <span class=\"content\">\n                           <b>\n                              <span style=\"text-decoration: underline\">Patch:</span></b></span></li>\n                     <li class=\"statement\">\n                        <span style=\"display:none;\" class=\"attributes\">\n                           <span class=\"link\">urn:lims:b498:s2694797</span>\n                           <span class=\"entity\">&bull;</span></span>\n                        <span class=\"content\">Do not use patches that are cut or do not look right.</span></li>\n                     <li class=\"statement\">\n                        <span style=\"display:none;\" class=\"attributes\">\n                           <span class=\"link\">urn:lims:b498:s2694478</span>\n                           <span class=\"entity\">&bull;</span></span>\n                        <span class=\"content\">Put patch on clean, dry, healthy skin on back, belly, thigh, or upper arm.</span></li>\n                     <li class=\"statement\">\n                        <span style=\"display:none;\" class=\"attributes\">\n                           <span class=\"link\">urn:lims:b498:s6335079</span>\n                           <span class=\"entity\">&bull;</span></span>\n                        <span class=\"content\">Do not put on an area that is bony. Do not put on an area that will have pressure on it for a long time while sleeping or sitting.</span></li>\n                     <li class=\"statement\">\n                        <span style=\"display:none;\" class=\"attributes\">\n                           <span class=\"link\">urn:lims:b498:s2998401</span>\n                           <span class=\"entity\">&bull;</span></span>\n                        <span class=\"content\">Do not put on the genitals.</span></li>\n                     <li class=\"statement\">\n                        <span style=\"display:none;\" class=\"attributes\">\n                           <span class=\"link\">urn:lims:b498:s5099163</span>\n                           <span class=\"entity\">&bull;</span></span>\n                        <span class=\"content\">Put on a new patch at the same time every night. Be sure to take off the old patch before you put on the new one.</span></li>\n                     <li class=\"statement\">\n                        <span style=\"display:none;\" class=\"attributes\">\n                           <span class=\"link\">urn:lims:b498:s4734543</span>\n                           <span class=\"entity\">&bull;</span></span>\n                        <span class=\"content\">Move the patch site with each new patch. Do not put on the same site for 7 days.</span></li>\n                     <li class=\"statement\">\n                        <span style=\"display:none;\" class=\"attributes\">\n                           <span class=\"link\">urn:lims:b498:s3560844</span>\n                           <span class=\"entity\">&bull;</span></span>\n                        <span class=\"content\">Do not bathe, shower, or swim for 3 hours after putting on.</span></li>\n                     <li class=\"statement\">\n                        <span style=\"display:none;\" class=\"attributes\">\n                           <span class=\"link\">urn:lims:b498:s4790825</span>\n                           <span class=\"entity\">&bull;</span></span>\n                        <span class=\"content\">Do not cover the patch with other bandages or tape. If the patch does not stick well, talk with your doctor or pharmacist. </span></li>\n                     <li class=\"statement\">\n                        <span style=\"display:none;\" class=\"attributes\">\n                           <span class=\"link\">urn:lims:b498:s5099164</span>\n                           <span class=\"entity\">&bull;</span></span>\n                        <span class=\"content\">If your patch falls off before noon, put on a new patch and wear it until you put on a new patch at your normal time.</span></li>\n                     <li class=\"statement\">\n                        <span style=\"display:none;\" class=\"attributes\">\n                           <span class=\"link\">urn:lims:b498:s5099166</span>\n                           <span class=\"entity\">&bull;</span></span>\n                        <span class=\"content\">If your patch falls off after noon, do not put on a new one. Wait and put on a new patch at your normal time.</span></li>\n                     <li class=\"statement\">\n                        <span style=\"display:none;\" class=\"attributes\">\n                           <span class=\"link\">urn:lims:b498:s2699145</span>\n                           <span class=\"entity\">&bull;</span></span>\n                        <span class=\"content\">After you take off a skin patch, be sure to fold the sticky sides of the patch to each other.</span></li>\n                     <li class=\"statement\">\n                        <span style=\"display:none;\" class=\"attributes\">\n                           <span class=\"link\">urn:lims:b498:s2705346</span></span>\n                        <span class=\"content\">\n                           <b>\n                              <span style=\"text-decoration: underline\">Cheek tablet:</span></b></span></li>\n                     <li class=\"statement\">\n                        <span style=\"display:none;\" class=\"attributes\">\n                           <span class=\"link\">urn:lims:b498:s4471685</span>\n                           <span class=\"entity\">&bull;</span></span>\n                        <span class=\"content\">Do not take this drug out of the blister pack until you are ready to take it. Take this drug right away after opening the blister pack. Do not store the removed drug for future use.</span></li>\n                     <li class=\"statement\">\n                        <span style=\"display:none;\" class=\"attributes\">\n                           <span class=\"link\">urn:lims:b498:s2876780</span>\n                           <span class=\"entity\">&bull;</span></span>\n                        <span class=\"content\">Dry your hands and place the tablet in your mouth above the incisor tooth between the upper cheek and gum. Let it melt during the day.</span></li>\n                     <li class=\"statement\">\n                        <span style=\"display:none;\" class=\"attributes\">\n                           <span class=\"link\">urn:lims:b498:s2696380</span>\n                           <span class=\"entity\">&bull;</span></span>\n                        <span class=\"content\">Do not chew or swallow.</span></li>\n                     <li class=\"statement\">\n                        <span style=\"display:none;\" class=\"attributes\">\n                           <span class=\"link\">urn:lims:b498:s2998423</span>\n                           <span class=\"entity\">&bull;</span></span>\n                        <span class=\"content\">Change the side of mouth with each dose.</span></li>\n                     <li class=\"statement\">\n                        <span style=\"display:none;\" class=\"attributes\">\n                           <span class=\"link\">urn:lims:b498:s4734562</span>\n                           <span class=\"entity\">&bull;</span></span>\n                        <span class=\"content\">Do not take out until it is time for your next dose.</span></li>\n                     <li class=\"statement\">\n                        <span style=\"display:none;\" class=\"attributes\">\n                           <span class=\"link\">urn:lims:b498:s4734563</span>\n                           <span class=\"entity\">&bull;</span></span>\n                        <span class=\"content\">Make sure drug is still in place after eating, drinking, brushing your teeth, or using  mouthwash.</span></li>\n                     <li class=\"statement\">\n                        <span style=\"display:none;\" class=\"attributes\">\n                           <span class=\"link\">urn:lims:b498:s5094962</span>\n                           <span class=\"entity\">&bull;</span></span>\n                        <span class=\"content\">If the drug does not stick or falls out, follow what your doctor has told you or read the package insert. If you are not sure what to do, talk with your doctor.</span></li>\n                     <li class=\"statement\">\n                        <span style=\"display:none;\" class=\"attributes\">\n                           <span class=\"link\">urn:lims:b498:s4734568</span>\n                           <span class=\"entity\">&bull;</span></span>\n                        <span class=\"content\">To remove tablet, gently slide it down from the gum toward the tooth to keep from scratching the gum.</span></li>\n                     <li class=\"statement\">\n                        <span style=\"display:none;\" class=\"attributes\">\n                           <span class=\"link\">urn:lims:b498:s5005902</span></span>\n                        <span class=\"content\">\n                           <b>\n                              <span style=\"text-decoration: underline\">All injection products:</span></b></span></li>\n                     <li class=\"statement\">\n                        <span style=\"display:none;\" class=\"attributes\">\n                           <span class=\"link\">urn:lims:b498:s2695985</span>\n                           <span class=\"entity\">&bull;</span></span>\n                        <span class=\"content\">It is given as a shot into a muscle.</span></li>\n                     <li class=\"statement\">\n                        <span style=\"display:none;\" class=\"attributes\">\n                           <span class=\"link\">urn:lims:b498:s5099182</span></span>\n                        <span class=\"content\">\n                           <b>\n                              <span style=\"text-decoration: underline\">Testosterone undecanoate:</span></b></span></li>\n                     <li class=\"statement\">\n                        <span style=\"display:none;\" class=\"attributes\">\n                           <span class=\"link\">urn:lims:b498:s2696366</span>\n                           <span class=\"entity\">&bull;</span></span>\n                        <span class=\"content\">Your doctor will give this drug.</span></li>\n                     <li class=\"statement\">\n                        <span style=\"display:none;\" class=\"attributes\">\n                           <span class=\"link\">urn:lims:b498:s6335069</span></span>\n                        <span class=\"content\">\n                           <span style=\"text-decoration: underline\">\n                              <b>All other injection products:</b></span></span></li>\n                     <li class=\"statement\">\n                        <span style=\"display:none;\" class=\"attributes\">\n                           <span class=\"link\">urn:lims:b498:s2696367</span>\n                           <span class=\"entity\">&bull;</span></span>\n                        <span class=\"content\">If you will be giving yourself the shot, your doctor or nurse will teach you how to give the shot. </span></li>\n                     <li class=\"statement\">\n                        <span style=\"display:none;\" class=\"attributes\">\n                           <span class=\"link\">urn:lims:b498:s2694870</span>\n                           <span class=\"entity\">&bull;</span></span>\n                        <span class=\"content\">Follow how to use as you have been told by the doctor or read the package insert.</span></li>\n                     <li class=\"statement\">\n                        <span style=\"display:none;\" class=\"attributes\">\n                           <span class=\"link\">urn:lims:b498:s2699169</span>\n                           <span class=\"entity\">&bull;</span></span>\n                        <span class=\"content\">Do not use if the solution is cloudy, leaking, or has particles.</span></li>\n                     <li class=\"statement\">\n                        <span style=\"display:none;\" class=\"attributes\">\n                           <span class=\"link\">urn:lims:b498:s2699166</span>\n                           <span class=\"entity\">&bull;</span></span>\n                        <span class=\"content\">Do not use if solution changes color.</span></li>\n                     <li class=\"statement\">\n                        <span style=\"display:none;\" class=\"attributes\">\n                           <span class=\"link\">urn:lims:b498:s2696118</span>\n                           <span class=\"entity\">&bull;</span></span>\n                        <span class=\"content\">Throw away needles in a needle/sharp disposal box. Do not reuse needles or other items. When the box is full, follow all local rules for getting rid of it. Talk with a doctor or pharmacist if you have any questions.</span></li></ul></div>\r\n<div xmlns=\"http://www.w3.org/1999/xhtml\" id=\"F10028436\" class=\"ord-stmt yyd-os drugH1Div\"><span class=\"drugH1\">What do I do if I miss a dose?</span>\n                  <ul style=\"list-style-type:none;\" class=\"statements\">\n                     <li class=\"statement\">\n                        <span style=\"display:none;\" class=\"attributes\">\n                           <span class=\"link\">urn:lims:b498:s5099182</span></span>\n                        <span class=\"content\">\n                           <b>\n                              <span style=\"text-decoration: underline\">Testosterone undecanoate:</span></b></span></li>\n                     <li class=\"statement\">\n                        <span style=\"display:none;\" class=\"attributes\">\n                           <span class=\"link\">urn:lims:b498:s2696446</span>\n                           <span class=\"entity\">&bull;</span></span>\n                        <span class=\"content\">Call your doctor to find out what to do.</span></li>\n                     <li class=\"statement\">\n                        <span style=\"display:none;\" class=\"attributes\">\n                           <span class=\"link\">urn:lims:b498:s2705328</span></span>\n                        <span class=\"content\">\n                           <b>\n                              <span style=\"text-decoration: underline\">All other products:</span></b></span></li>\n                     <li class=\"statement\">\n                        <span style=\"display:none;\" class=\"attributes\">\n                           <span class=\"link\">urn:lims:b498:s2696583</span>\n                           <span class=\"entity\">&bull;</span></span>\n                        <span class=\"content\">Use a missed dose as soon as you think about it.</span></li>\n                     <li class=\"statement\">\n                        <span style=\"display:none;\" class=\"attributes\">\n                           <span class=\"link\">urn:lims:b498:s2696496</span>\n                           <span class=\"entity\">&bull;</span></span>\n                        <span class=\"content\">If it is close to the time for your next dose, skip the missed dose and go back to your normal time.</span></li>\n                     <li class=\"statement\">\n                        <span style=\"display:none;\" class=\"attributes\">\n                           <span class=\"link\">urn:lims:b498:s2696485</span>\n                           <span class=\"entity\">&bull;</span></span>\n                        <span class=\"content\">Do not use 2 doses or extra doses.</span></li></ul></div>\r\n<div xmlns=\"http://www.w3.org/1999/xhtml\" id=\"F10028441\" class=\"ord-stmt yyi-os drugH1Div\"><span class=\"drugH1\">How do I store and/or throw out this drug?</span>\n                  <ul style=\"list-style-type:none;\" class=\"statements\">\n                     <li class=\"statement\">\n                        <span style=\"display:none;\" class=\"attributes\">\n                           <span class=\"link\">urn:lims:b498:s5455987</span></span>\n                        <span class=\"content\">\n                           <b>\n                              <span style=\"text-decoration: underline\">All products other than injection:</span></b></span></li>\n                     <li class=\"statement\">\n                        <span style=\"display:none;\" class=\"attributes\">\n                           <span class=\"link\">urn:lims:b498:s2699340</span>\n                           <span class=\"entity\">&bull;</span></span>\n                        <span class=\"content\">Store at room temperature. Do not freeze.</span></li>\n                     <li class=\"statement\">\n                        <span style=\"display:none;\" class=\"attributes\">\n                           <span class=\"link\">urn:lims:b498:s2699266</span>\n                           <span class=\"entity\">&bull;</span></span>\n                        <span class=\"content\">Store in a dry place. Do not store in a bathroom.</span></li>\n                     <li class=\"statement\">\n                        <span style=\"display:none;\" class=\"attributes\">\n                           <span class=\"link\">urn:lims:b498:s2810666</span></span>\n                        <span class=\"content\">\n                           <b>\n                              <span style=\"text-decoration: underline\">Skin gel, skin solution:</span></b></span></li>\n                     <li class=\"statement\">\n                        <span style=\"display:none;\" class=\"attributes\">\n                           <span class=\"link\">urn:lims:b498:s2699261</span>\n                           <span class=\"entity\">&bull;</span></span>\n                        <span class=\"content\">Protect from heat or open flame.</span></li>\n                     <li class=\"statement\">\n                        <span style=\"display:none;\" class=\"attributes\">\n                           <span class=\"link\">urn:lims:b498:s2705346</span></span>\n                        <span class=\"content\">\n                           <b>\n                              <span style=\"text-decoration: underline\">Cheek tablet:</span></b></span></li>\n                     <li class=\"statement\">\n                        <span style=\"display:none;\" class=\"attributes\">\n                           <span class=\"link\">urn:lims:b498:s2699262</span>\n                           <span class=\"entity\">&bull;</span></span>\n                        <span class=\"content\">Protect from heat.</span></li>\n                     <li class=\"statement\">\n                        <span style=\"display:none;\" class=\"attributes\">\n                           <span class=\"link\">urn:lims:b498:s2705500</span></span>\n                        <span class=\"content\">\n                           <b>\n                              <span style=\"text-decoration: underline\">Patch:</span></b></span></li>\n                     <li class=\"statement\">\n                        <span style=\"display:none;\" class=\"attributes\">\n                           <span class=\"link\">urn:lims:b498:s2699405</span>\n                           <span class=\"entity\">&bull;</span></span>\n                        <span class=\"content\">Store in pouch until ready for use.</span></li>\n                     <li class=\"statement\">\n                        <span style=\"display:none;\" class=\"attributes\">\n                           <span class=\"link\">urn:lims:b498:s5945110</span></span>\n                        <span class=\"content\">\n                           <b>\n                              <span style=\"text-decoration: underline\">Injection:</span></b></span></li>\n                     <li class=\"statement\">\n                        <span style=\"display:none;\" class=\"attributes\">\n                           <span class=\"link\">urn:lims:b498:s2699596</span>\n                           <span class=\"entity\">&bull;</span></span>\n                        <span class=\"content\">If you need to store this drug at home, talk with your doctor, nurse, or pharmacist about how to store it.</span></li>\n                     <li class=\"statement\">\n                        <span style=\"display:none;\" class=\"attributes\">\n                           <span class=\"link\">urn:lims:b498:s2705324</span></span>\n                        <span class=\"content\">\n                           <b>\n                              <span style=\"text-decoration: underline\">All products:</span></b></span></li>\n                     <li class=\"statement\">\n                        <span style=\"display:none;\" class=\"attributes\">\n                           <span class=\"link\">urn:lims:b498:s2699678</span>\n                           <span class=\"entity\">&bull;</span></span>\n                        <span class=\"content\">Keep all drugs in a safe place. Keep all drugs out of the reach of children and pets.</span></li>\n                     <li class=\"statement\">\n                        <span style=\"display:none;\" class=\"attributes\">\n                           <span class=\"link\">urn:lims:b498:s4194563</span>\n                           <span class=\"entity\">&bull;</span></span>\n                        <span class=\"content\">Throw away unused or expired drugs. Do not flush down a toilet or pour down a drain unless you are told to do so. Check with your pharmacist if you have questions about the best way to throw out drugs. There may be drug take-back programs in your area.</span></li></ul></div>\r\n<div xmlns=\"http://www.w3.org/1999/xhtml\" id=\"F10028442\" class=\"ord-stmt yyj-os drugH1Div\"><span class=\"drugH1\">General drug facts</span>\n                  <ul style=\"list-style-type:none;\" class=\"statements\">\n                     <li class=\"statement\">\n                        <span style=\"display:none;\" class=\"attributes\">\n                           <span class=\"link\">urn:lims:b498:s2699675</span>\n                           <span class=\"entity\">&bull;</span></span>\n                        <span class=\"content\">If your symptoms or health problems do not get better or if they become worse, call your doctor. </span></li>\n                     <li class=\"statement\">\n                        <span style=\"display:none;\" class=\"attributes\">\n                           <span class=\"link\">urn:lims:b498:s2699673</span>\n                           <span class=\"entity\">&bull;</span></span>\n                        <span class=\"content\">Do not share your drugs with others and do not take anyone else's drugs.</span></li>\n                     <li class=\"statement\">\n                        <span style=\"display:none;\" class=\"attributes\">\n                           <span class=\"link\">urn:lims:b498:s2699677</span>\n                           <span class=\"entity\">&bull;</span></span>\n                        <span class=\"content\">Keep a list of all your drugs (prescription, natural products, vitamins, OTC) with you. Give this list to your doctor.</span></li>\n                     <li class=\"statement\">\n                        <span style=\"display:none;\" class=\"attributes\">\n                           <span class=\"link\">urn:lims:b498:s2699683</span>\n                           <span class=\"entity\">&bull;</span></span>\n                        <span class=\"content\">Talk with the doctor before starting any new drug, including prescription or OTC, natural products, or vitamins.</span></li>\n                     <li class=\"statement\">\n                        <span style=\"display:none;\" class=\"attributes\">\n                           <span class=\"link\">urn:lims:b498:s2699709</span>\n                           <span class=\"entity\">&bull;</span>\n                           <span class=\"country-exclude list\">\n                              <span>US</span></span></span>\n                        <span class=\"content\">Some drugs may have another patient information leaflet. If you have any questions about this drug, please talk with your doctor, nurse, pharmacist, or other health care provider.</span></li>\n                     <li class=\"statement\">\n                        <span style=\"display:none;\" class=\"attributes\">\n                           <span class=\"link\">urn:lims:b498:s2698721</span>\n                           <span class=\"entity\">&bull;</span></span>\n                        <span class=\"content\">If you think there has been an overdose, call your poison control center or get medical care right away. Be ready to tell or show what was taken, how much, and when it happened.</span></li></ul></div>\r\n</div><div id=\"topicAgreement\">Use of UpToDate is subject to the <a href=\"https://www.uptodate.com/legal/license\" class=\"licenseLink\" id=\"sla_in_page\">Subscription and License Agreement</a>.</div><div id=\"topicVersionRevision\">Topic 11879 Version 189.0</div></div>","outline":"<div id=\"outlineSections\"><h2>Topic Outline</h2><ul><li class=\"plainItem\"><a sectionName=\"Brand Names: US\" href=\"#F225996\" class=\"outlineLink\">Brand Names: US</a></li><li class=\"plainItem\"><a sectionName=\"Brand Names: Canada\" href=\"#F225997\" class=\"outlineLink\">Brand Names: Canada</a></li><li class=\"plainItem\"><a sectionName=\"Warning\" href=\"#F10028431\" class=\"outlineLink\">Warning</a></li><li class=\"plainItem\"><a sectionName=\"What is this drug used for?\" href=\"#F10028433\" class=\"outlineLink\">What is this drug used for?</a></li><li class=\"plainItem\"><a sectionName=\"What do I need to tell my doctor BEFORE I take this drug?\" href=\"#F10028432\" class=\"outlineLink\">What do I need to tell my doctor BEFORE I take this drug?</a></li><li class=\"plainItem\"><a sectionName=\"What are some things I need to know or do while I take this drug?\" href=\"#F10028437\" class=\"outlineLink\">What are some things I need to know or do while I take this drug?</a></li><li class=\"plainItem\"><a sectionName=\"What are some side effects that I need to call my doctor about right away?\" href=\"#F10028440\" class=\"outlineLink\">What are some side effects that I need to call my doctor about right away?</a></li><li class=\"plainItem\"><a sectionName=\"What are some other side effects of this drug?\" href=\"#F10028438\" class=\"outlineLink\">What are some other side effects of this drug?</a></li><li class=\"plainItem\"><a sectionName=\"How is this drug best taken?\" href=\"#F10028435\" class=\"outlineLink\">How is this drug best taken?</a></li><li class=\"plainItem\"><a sectionName=\"What do I do if I miss a dose?\" href=\"#F10028436\" class=\"outlineLink\">What do I do if I miss a dose?</a></li><li class=\"plainItem\"><a sectionName=\"How do I store and/or throw out this drug?\" href=\"#F10028441\" class=\"outlineLink\">How do I store and/or throw out this drug?</a></li><li class=\"plainItem\"><a sectionName=\"General drug facts\" href=\"#F10028442\" class=\"outlineLink\">General drug facts</a></li></ul></div><div><h2>RELATED TOPICS</h2><div id=\"outlineTopics\"><ul><li><a href=\"topic.htm?path=testosterone-drug-information\" class=\"drug drug_general\">Testosterone: Drug information</a></li><li><a href=\"topic.htm?path=testosterone-pediatric-drug-information\" class=\"drug drug_pediatric\">Testosterone: Pediatric drug information</a></li></ul></div></div>","javascript":null}